// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Counters.sol";

/**
 * @title EmpowerHer
 * @dev Decentralized platform for women's empowerment with content monetization
 * @notice Creators earn BDAG tokens based on views and engagement
 */
contract EmpowerHer is ReentrancyGuard, Ownable {
	using Counters for Counters.Counter;

	Counters.Counter private _contentIds;
	Counters.Counter private _courseIds;

	uint256 public constant PLATFORM_FEE = 200; // 2% (200/10000)
	uint256 public constant FEE_DENOMINATOR = 10000;
	uint256 public paymentPerView = 1000000000000000; // 0.001 BDAG

	struct Content {
		uint256 id;
		address creator;
		string title;
		string description;
		string ipfsHash;
		uint256 views;
		uint256 likes;
		uint256 earnings;
		uint256 category;
		uint256 timestamp;
		bool isActive;
	}

	struct Course {
		uint256 id;
		address instructor;
		string title;
		string description;
		string ipfsHash;
		uint256 duration;
		uint256 enrolledCount;
		bool isActive;
		uint256 timestamp;
	}

	struct Creator {
		uint256 totalViews;
		uint256 totalEarnings;
		uint256 contentCount;
		bool isVerified;
		string profileIpfsHash;
	}

	struct Student {
		uint256[] enrolledCourses;
		uint256[] completedCourses;
		mapping(uint256 => bool) hasCertificate;
	}

	mapping(uint256 => Content) public contents;
	mapping(uint256 => Course) public courses;
	mapping(address => Creator) public creators;
	mapping(address => Student) private students;
	mapping(address => uint256) public pendingWithdrawals;
	mapping(uint256 => mapping(address => bool)) public hasLiked;
	mapping(uint256 => mapping(address => bool)) public hasViewed;
	mapping(uint256 => mapping(address => bool)) public courseEnrollments;
	mapping(uint256 => mapping(address => bool)) public courseCompletions;

	uint256[] public activeContentIds;
	uint256[] public activeCourseIds;

	uint256 public adRevenuePool;
	uint256 public totalPlatformFees;

	event ContentUploaded(uint256 indexed contentId, address indexed creator, string title);
	event ContentViewed(uint256 indexed contentId, address indexed viewer);
	event ContentLiked(uint256 indexed contentId, address indexed liker);
	event EarningsWithdrawn(address indexed creator, uint256 amount);
	event CourseCreated(uint256 indexed courseId, address indexed instructor, string title);
	event CourseEnrolled(uint256 indexed courseId, address indexed student);
	event CourseCompleted(uint256 indexed courseId, address indexed student);
	event AdRevenueAdded(uint256 amount);
	event CreatorVerified(address indexed creator);

	constructor() {}

	modifier onlyCreator(uint256 _contentId) {
		require(contents[_contentId].creator == msg.sender, "Not the content creator");
		_;
	}

	modifier onlyInstructor(uint256 _courseId) {
		require(courses[_courseId].instructor == msg.sender, "Not the course instructor");
		_;
	}

	modifier contentExists(uint256 _contentId) {
		require(_contentId > 0 && _contentId <= _contentIds.current(), "Content does not exist");
		require(contents[_contentId].isActive, "Content is not active");
		_;
	}

	modifier courseExists(uint256 _courseId) {
		require(_courseId > 0 && _courseId <= _courseIds.current(), "Course does not exist");
		require(courses[_courseId].isActive, "Course is not active");
		_;
	}

	function uploadContent(string memory _title, string memory _description, string memory _ipfsHash, uint256 _category) external {
		require(bytes(_title).length > 0, "Title cannot be empty");
		require(bytes(_description).length > 0, "Description cannot be empty");
		require(bytes(_ipfsHash).length > 0, "IPFS hash cannot be empty");
		require(_category < 10, "Invalid category");

		_contentIds.increment();
		uint256 newContentId = _contentIds.current();

		contents[newContentId] = Content({
			id: newContentId,
			creator: msg.sender,
			title: _title,
			description: _description,
			ipfsHash: _ipfsHash,
			views: 0,
			likes: 0,
			earnings: 0,
			category: _category,
			timestamp: block.timestamp,
			isActive: true
		});

		activeContentIds.push(newContentId);
		creators[msg.sender].contentCount++;

		emit ContentUploaded(newContentId, msg.sender, _title);
	}

	function viewContent(uint256 _contentId) external payable contentExists(_contentId) {
		require(!hasViewed[_contentId][msg.sender], "Already viewed this content");

		Content storage content = contents[_contentId];
		hasViewed[_contentId][msg.sender] = true;
		content.views++;
		creators[content.creator].totalViews++;

		uint256 payment = 0;
		if (adRevenuePool >= paymentPerView) {
			payment = paymentPerView;
			uint256 platformFee = (payment * PLATFORM_FEE) / FEE_DENOMINATOR;
			uint256 creatorPayment = payment - platformFee;

			content.earnings += creatorPayment;
			creators[content.creator].totalEarnings += creatorPayment;
			pendingWithdrawals[content.creator] += creatorPayment;

			adRevenuePool -= payment;
			totalPlatformFees += platformFee;
		}

		emit ContentViewed(_contentId, msg.sender);
	}

	function likeContent(uint256 _contentId) external contentExists(_contentId) {
		require(!hasLiked[_contentId][msg.sender], "Already liked this content");
		hasLiked[_contentId][msg.sender] = true;
		contents[_contentId].likes++;
		emit ContentLiked(_contentId, msg.sender);
	}

	function getContent(uint256 _contentId) external view returns (Content memory) {
		return contents[_contentId];
	}

	function getAllContent() external view returns (uint256[] memory) {
		return activeContentIds;
	}

	function getCreatorContent(address _creator) external view returns (uint256[] memory) {
		uint256[] memory creatorContent = new uint256[](creators[_creator].contentCount);
		uint256 index = 0;
		for (uint256 i = 0; i < activeContentIds.length; i++) {
			if (contents[activeContentIds[i]].creator == _creator) {
				creatorContent[index] = activeContentIds[i];
				index++;
			}
		}
		return creatorContent;
	}

	function createCourse(string memory _title, string memory _description, string memory _ipfsHash, uint256 _duration) external {
		require(bytes(_title).length > 0, "Title cannot be empty");
		require(bytes(_description).length > 0, "Description cannot be empty");
		require(bytes(_ipfsHash).length > 0, "IPFS hash cannot be empty");
		require(_duration > 0, "Duration must be greater than 0");

		_courseIds.increment();
		uint256 newCourseId = _courseIds.current();

		courses[newCourseId] = Course({
			id: newCourseId,
			instructor: msg.sender,
			title: _title,
			description: _description,
			ipfsHash: _ipfsHash,
			duration: _duration,
			enrolledCount: 0,
			isActive: true,
			timestamp: block.timestamp
		});

		activeCourseIds.push(newCourseId);
		emit CourseCreated(newCourseId, msg.sender, _title);
	}

	function enrollInCourse(uint256 _courseId) external courseExists(_courseId) {
		require(!courseEnrollments[_courseId][msg.sender], "Already enrolled in this course");
		courseEnrollments[_courseId][msg.sender] = true;
		courses[_courseId].enrolledCount++;
		students[msg.sender].enrolledCourses.push(_courseId);
		emit CourseEnrolled(_courseId, msg.sender);
	}

	function completeCourse(uint256 _courseId) external courseExists(_courseId) {
		require(courseEnrollments[_courseId][msg.sender], "Not enrolled in this course");
		require(!courseCompletions[_courseId][msg.sender], "Already completed this course");
		courseCompletions[_courseId][msg.sender] = true;
		students[msg.sender].completedCourses.push(_courseId);
		students[msg.sender].hasCertificate[_courseId] = true;
		emit CourseCompleted(_courseId, msg.sender);
	}

	function getAllCourses() external view returns (uint256[] memory) {
		return activeCourseIds;
	}

	function hasCertificate(address _student, uint256 _courseId) external view returns (bool) {
		return students[_student].hasCertificate[_courseId];
	}

	function addAdRevenue() external payable {
		require(msg.value > 0, "Must send BDAG tokens");
		adRevenuePool += msg.value;
		emit AdRevenueAdded(msg.value);
	}

	function getCreatorEarnings(address _creator) external view returns (uint256) {
		return pendingWithdrawals[_creator];
	}

	function withdrawEarnings() external nonReentrant {
		uint256 amount = pendingWithdrawals[msg.sender];
		require(amount > 0, "No earnings to withdraw");
		pendingWithdrawals[msg.sender] = 0;
		(bool success, ) = payable(msg.sender).call{value: amount}("");
		require(success, "Withdrawal failed");
		emit EarningsWithdrawn(msg.sender, amount);
	}

	function emergencyWithdraw() external onlyOwner {
		uint256 balance = address(this).balance;
		require(balance > 0, "No funds to withdraw");
		(bool success, ) = payable(owner()).call{value: balance}("");
		require(success, "Emergency withdrawal failed");
	}

	function verifyCreator(address _creator) external onlyOwner {
		creators[_creator].isVerified = true;
		emit CreatorVerified(_creator);
	}

	function updatePaymentPerView(uint256 _newPayment) external onlyOwner {
		paymentPerView = _newPayment;
	}

	function deactivateContent(uint256 _contentId) external onlyOwner {
		require(_contentId <= _contentIds.current(), "Content does not exist");
		contents[_contentId].isActive = false;
	}

	function withdrawPlatformFees() external onlyOwner nonReentrant {
		uint256 amount = totalPlatformFees;
		require(amount > 0, "No platform fees to withdraw");
		totalPlatformFees = 0;
		(bool success, ) = payable(owner()).call{value: amount}("");
		require(success, "Platform fee withdrawal failed");
	}

	function getPlatformStats() external view returns (uint256 totalContent, uint256 totalCourses, uint256 totalViews, uint256 adPool, uint256 platformFees) {
		uint256 views = 0;
		for (uint256 i = 0; i < activeContentIds.length; i++) {
			views += contents[activeContentIds[i]].views;
		}
		return (_contentIds.current(), _courseIds.current(), views, adRevenuePool, totalPlatformFees);
	}

	function getCreatorProfile(address _creator) external view returns (Creator memory) {
		return creators[_creator];
	}

	function getStudentCourses(address _student) external view returns (uint256[] memory enrolled, uint256[] memory completed) {
		return (students[_student].enrolledCourses, students[_student].completedCourses);
	}

	receive() external payable {
		adRevenuePool += msg.value;
		emit AdRevenueAdded(msg.value);
	}
}

contracts/SistaCircle.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Counters.sol";

/**
 * @title SistaCircle
 * @dev A decentralized savings circle (stokvel) platform empowering women's financial independence
 * Built for BlockDAG network with enhanced security and transparency
 */
contract SistaCircle is ReentrancyGuard, Ownable {
    using Counters for Counters.Counter;
    
    Counters.Counter private _circleIdCounter;
    
    // Circle states
    enum CircleState { Active, Completed, Cancelled }
    
    // Member status in a circle
    enum MemberStatus { Active, Defaulted, Withdrawn }
    
    struct Circle {
        uint256 id;
        string name;
        string description;
        address creator;
        uint256 contributionAmount;
        uint256 totalRounds;
        uint256 currentRound;
        uint256 maxMembers;
        uint256 memberCount;
        uint256 startTime;
        uint256 roundDuration; // in seconds
        CircleState state;
        bool requiresApproval;
        uint256 totalFunds;
        uint256 emergencyFund; // 5% of contributions for emergencies
        mapping(address => Member) members;
        mapping(uint256 => address) roundRecipients;
        address[] memberAddresses;
    }
    
    struct Member {
        bool isActive;
        MemberStatus status;
        uint256 contributionsMade;
        uint256 roundReceived; // 0 if not received yet
        uint256 lastContributionTime;
        string profileInfo; // IPFS hash for additional info
    }
    
    struct CircleInfo {
        uint256 id;
        string name;
        string description;
        address creator;
        uint256 contributionAmount;
        uint256 totalRounds;
        uint256 currentRound;
        uint256 maxMembers;
        uint256 memberCount;
        uint256 startTime;
        uint256 roundDuration;
        CircleState state;
        bool requiresApproval;
        uint256 totalFunds;
        uint256 emergencyFund;
    }
    
    // Mappings
    mapping(uint256 => Circle) public circles;
    mapping(address => uint256[]) public userCircles;
    mapping(address => bool) public verifiedMembers;
    
    // Events
    event CircleCreated(uint256 indexed circleId, address indexed creator, string name);
    event MemberJoined(uint256 indexed circleId, address indexed member);
    event ContributionMade(uint256 indexed circleId, address indexed member, uint256 amount);
    event PayoutDistributed(uint256 indexed circleId, address indexed recipient, uint256 amount);
    event CircleCompleted(uint256 indexed circleId);
    event EmergencyWithdrawal(uint256 indexed circleId, address indexed member, uint256 amount);
    event MemberVerified(address indexed member);
    
    // Modifiers
    modifier onlyCircleMember(uint256 _circleId) {
        require(circles[_circleId].members[msg.sender].isActive, "Not a circle member");
        _;
    }
    
    modifier circleExists(uint256 _circleId) {
        require(_circleId <= _circleIdCounter.current() && _circleId > 0, "Circle does not exist");
        _;
    }
    
    constructor() {}
    
    /**
     * @dev Create a new savings circle
     */
    function createCircle(
        string memory _name,
        string memory _description,
        uint256 _contributionAmount,
        uint256 _totalRounds,
        uint256 _maxMembers,
        uint256 _roundDuration,
        bool _requiresApproval
    ) external {
        require(_contributionAmount > 0, "Contribution amount must be positive");
        require(_totalRounds >= 2 && _totalRounds <= 52, "Invalid rounds (2-52)");
        require(_maxMembers >= 3 && _maxMembers <= 20, "Invalid member count (3-20)");
        require(_maxMembers == _totalRounds, "Members must equal rounds");
        require(_roundDuration >= 1 days, "Minimum round duration is 1 day");
        
        _circleIdCounter.increment();
        uint256 circleId = _circleIdCounter.current();
        
        Circle storage newCircle = circles[circleId];
        newCircle.id = circleId;
        newCircle.name = _name;
        newCircle.description = _description;
        newCircle.creator = msg.sender;
        newCircle.contributionAmount = _contributionAmount;
        newCircle.totalRounds = _totalRounds;
        newCircle.currentRound = 0;
        newCircle.maxMembers = _maxMembers;
        newCircle.memberCount = 1;
        newCircle.startTime = 0; // Will be set when circle is full
        newCircle.roundDuration = _roundDuration;
        newCircle.state = CircleState.Active;
        newCircle.requiresApproval = _requiresApproval;
        
        // Add creator as first member
        newCircle.members[msg.sender] = Member({
            isActive: true,
            status: MemberStatus.Active,
            contributionsMade: 0,
            roundReceived: 0,
            lastContributionTime: 0,
            profileInfo: ""
        });
        
        newCircle.memberAddresses.push(msg.sender);
        userCircles[msg.sender].push(circleId);
        
        emit CircleCreated(circleId, msg.sender, _name);
        emit MemberJoined(circleId, msg.sender);
    }
    
    /**
     * @dev Join an existing circle
     */
    function joinCircle(uint256 _circleId) external payable circleExists(_circleId) nonReentrant {
        Circle storage circle = circles[_circleId];
        
        require(circle.state == CircleState.Active, "Circle not active");
        require(circle.memberCount < circle.maxMembers, "Circle is full");
        require(!circle.members[msg.sender].isActive, "Already a member");
        require(circle.startTime == 0, "Circle already started");
        
        circle.members[msg.sender] = Member({
            isActive: true,
            status: MemberStatus.Active,
            contributionsMade: 0,
            roundReceived: 0,
            lastContributionTime: 0,
            profileInfo: ""
        });
        
        circle.memberAddresses.push(msg.sender);
        circle.memberCount++;
        userCircles[msg.sender].push(_circleId);
        
        // Start circle if full
        if (circle.memberCount == circle.maxMembers) {
            circle.startTime = block.timestamp;
            circle.currentRound = 1;
            _assignRoundRecipients(_circleId);
        }
        
        emit MemberJoined(_circleId, msg.sender);
    }
    
    /**
     * @dev Make a contribution to the circle
     */
    function contribute(uint256 _circleId) 
        external 
        payable 
        circleExists(_circleId) 
        onlyCircleMember(_circleId) 
        nonReentrant 
    {
        Circle storage circle = circles[_circleId];
        Member storage member = circle.members[msg.sender];
        
        require(circle.state == CircleState.Active, "Circle not active");
        require(circle.startTime > 0, "Circle not started");
        require(msg.value == circle.contributionAmount, "Incorrect contribution amount");
        require(member.status == MemberStatus.Active, "Member not in good standing");
        
        uint256 currentRoundEnd = circle.startTime + (circle.currentRound * circle.roundDuration);
        require(block.timestamp <= currentRoundEnd, "Round contribution period ended");
        
        uint256 expectedContributions = circle.currentRound;
        require(member.contributionsMade < expectedContributions, "Already contributed this round");
        
        member.contributionsMade++;
        member.lastContributionTime = block.timestamp;
        
        uint256 emergencyAmount = (msg.value * 5) / 100;
        uint256 circleAmount = msg.value - emergencyAmount;
        
        circle.totalFunds += circleAmount;
        circle.emergencyFund += emergencyAmount;
        
        emit ContributionMade(_circleId, msg.sender, msg.value);
        
        _checkRoundCompletion(_circleId);
    }
    
    /**
     * @dev Claim payout for the current round
     */
    function claimPayout(uint256 _circleId) 
        external 
        circleExists(_circleId) 
        onlyCircleMember(_circleId) 
        nonReentrant 
    {
        Circle storage circle = circles[_circleId];
        
        require(circle.roundRecipients[circle.currentRound] == msg.sender, "Not recipient for this round");
        require(circle.members[msg.sender].roundReceived == 0, "Already received payout");
        
        uint256 payout = circle.contributionAmount * circle.memberCount;
        require(circle.totalFunds >= payout, "Insufficient funds");
        
        circle.members[msg.sender].roundReceived = circle.currentRound;
        circle.totalFunds -= payout;
        
        (bool success, ) = msg.sender.call{value: payout}("");
        require(success, "Payout transfer failed");
        
        emit PayoutDistributed(_circleId, msg.sender, payout);
        
        if (circle.currentRound == circle.totalRounds) {
            circle.state = CircleState.Completed;
            emit CircleCompleted(_circleId);
        } else {
            circle.currentRound++;
        }
    }
    
    /**
     * @dev Emergency withdrawal (with penalties)
     */
    function emergencyWithdraw(uint256 _circleId) 
        external 
        circleExists(_circleId) 
        onlyCircleMember(_circleId) 
        nonReentrant 
    {
        Circle storage circle = circles[_circleId];
        Member storage member = circle.members[msg.sender];
        
        require(member.status == MemberStatus.Active, "Member not active");
        require(member.contributionsMade > 0, "No contributions made");
        
        uint256 totalContributed = member.contributionsMade * circle.contributionAmount;
        uint256 withdrawAmount = (totalContributed * 80) / 100;
        
        require(circle.emergencyFund >= withdrawAmount, "Insufficient emergency funds");
        
        member.status = MemberStatus.Withdrawn;
        circle.emergencyFund -= withdrawAmount;
        
        (bool success, ) = msg.sender.call{value: withdrawAmount}("");
        require(success, "Emergency withdrawal failed");
        
        emit EmergencyWithdrawal(_circleId, msg.sender, withdrawAmount);
    }
    
    function getCircleInfo(uint256 _circleId) 
        external 
        view 
        circleExists(_circleId) 
        returns (CircleInfo memory) 
    {
        Circle storage circle = circles[_circleId];
        return CircleInfo({
            id: circle.id,
            name: circle.name,
            description: circle.description,
            creator: circle.creator,
            contributionAmount: circle.contributionAmount,
            totalRounds: circle.totalRounds,
            currentRound: circle.currentRound,
            maxMembers: circle.maxMembers,
            memberCount: circle.memberCount,
            startTime: circle.startTime,
            roundDuration: circle.roundDuration,
            state: circle.state,
            requiresApproval: circle.requiresApproval,
            totalFunds: circle.totalFunds,
            emergencyFund: circle.emergencyFund
        });
    }
    
    function getMemberInfo(uint256 _circleId, address _member) 
        external 
        view 
        circleExists(_circleId) 
        returns (Member memory) 
    {
        return circles[_circleId].members[_member];
    }
    
    function getUserCircles(address _user) external view returns (uint256[] memory) {
        return userCircles[_user];
    }
    
    function getRoundRecipient(uint256 _circleId, uint256 _round) 
        external 
        view 
        circleExists(_circleId) 
        returns (address) 
    {
        return circles[_circleId].roundRecipients[_round];
    }
    
    function getTotalCircles() external view returns (uint256) {
        return _circleIdCounter.current();
    }
    
    function verifyMember(address _member) external onlyOwner {
        verifiedMembers[_member] = true;
        emit MemberVerified(_member);
    }
    
    // Internal helpers
    function _assignRoundRecipients(uint256 _circleId) internal {
        Circle storage circle = circles[_circleId];
        for (uint256 i = 0; i < circle.totalRounds; i++) {
            circle.roundRecipients[i + 1] = circle.memberAddresses[i];
        }
    }
    
    function _checkRoundCompletion(uint256 _circleId) internal {
        Circle storage circle = circles[_circleId];
        uint256 activeContributions = 0;
        for (uint256 i = 0; i < circle.memberAddresses.length; i++) {
            address memberAddr = circle.memberAddresses[i];
            if (
                circle.members[memberAddr].status == MemberStatus.Active &&
                circle.members[memberAddr].contributionsMade >= circle.currentRound
            ) {
                activeContributions++;
            }
        }
        // Hook for completion logic if needed
        activeContributions;
    }
    
    receive() external payable {}
}

